import React, {Fragment} from 'react';

import Expenses from "./components/Expenses/Expenses";
import NewExpense from './components/NewExpense/NewExpense';

function App() {

  return (
    <Fragment>
      <NewExpense/>
      <Expenses
        expenses={expenses}
      />
    </Fragment>
  );
}

export default App;
